const initialeState={
    ListeSimultaion : [
        {
            id: 3000000,
            Driots_en: 120000,
            Consevation: 45200,
            Dte: new Date().getDate(),
            total: 207950
        }
    ]
}
const FraisReducer = (state = initialeState, action) => {
    switch (action.type) {
        case "Ajouter":
            return {
                ListeSimultaion: [...state.ListeSimultaion, action.payload]
            } 
        case "Vider":
            return {
                ListeSimultaion: []
            }
        default:
            return state;
    }
} 

export default FraisReducer
